import React from 'react';
import image from '../../assets/cacto.jpg';
import img from '../../assets/dog3.jpg';

class Image extends React.Component {
    

    render() {

        return (
            <section className="image">
                <figure className='image__logo'>
                    <img className='image__header' src = {image} />
                </figure>
                <figure className='image__footer'>
                    <img src= {img} />
                </figure>
                {/* <h1 class='image__text'>Entrega em domicilio</h1> */}
            </section>
        );
    }

}

export default Image;
